function Random(min, max) {
    return Math.floor(Math.random() * (max - min)) + min;
}
function Colision(r1, r2) {
  
  var x = false;
  if (r1.x <= r2.x && r2.x < r1.x + r1.w)
    x = true;
  else if (r2.x <= r1.x && r1.x < r2.x + r2.w)
    x = true;
      
  var y = false;
  if (r1.y <= r2.y && r2.y < r1.y + r1.h)
    y = true;
  else if (r2.y <= r1.y && r1.y < r2.y + r2.h)
    y = true;
      
  return x && y;
}

class Player {
  constructor() {
    this.x = 125;
    this.y = 250;
    this.points = 0;
    this.life = 3;
  }
  move(direction) {
    if (keyIsDown(37) || keyIsDown(65))
      if (this.x - 1 >= 0)
        this.x-= 2;
    if (keyIsDown(39) || keyIsDown(68))
      if (this.x + 1 + 50 < 300)
        this.x+= 2;
    
    if (movedX != 0) {
      if (mouseX - 25 < 0)
        this.x = 0;
      else if (mouseX - 25 >= 250)
        this.x = 250;
      else
        this.x = mouseX - 25;
    }
  }
  draw() {
    var sprite = 0
    if (this.points > 0 && this.points < totalPoints/3)
      sprite = 1;
    else if (this.points >= totalPoints/3 && this.points < 2* totalPoints/3)
      sprite = 2;
    else if (this.points >= 2* totalPoints/3)
      sprite = 3;
      
    image(img.cart[sprite], this.x, this.y);
    
    if (millis() - damageCooldown <= 500)
    image(img.explotion[0], this.x, this.y);
  }
  hitbox() {
    return {
      x: this.x + 10,
      y: this.y + 5,
      w: 30,
      h: 5
    }
  }
}
class Coin {
    constructor() {
      this.isBomb = false;
      this.x = Random(0, 275);
      this.y = -50;
      this.type = Random(0, 3);
    }
    move() {
      this.y+=velocity;
    }
    draw() {
      image(img.digibyte[this.type], this.x, this.y, 25, 25);
    }
    hitbox() {
      return {
        x: this.x + 5,
        y: this.y + 5,
        w: 15,
        h: 5
      }
    }
}
class Bomb {
    constructor() {
      this.isBomb = true;
      this.x = Random(0, 275);
      this.y = -50;
      this.type = Random(0, 3);
    }
    move() {
      this.y++;
    }
    draw() {
      image(img.bomb[0], this.x, this.y, 25, 25);
    }
    hitbox() {
      return {
        x: this.x + 5,
        y: this.y + 5,
        w: 15,
        h: 5
      }
    }
}

let img;
let coins = [];
let coinsCooldown = 0;
let damageCooldown = 500;
let player = new Player();
let velocity = 1;
let totalPoints = 30;
let gameState = 'start';
let font;

function preload() {
 img = {
    digibyte: [
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,")
    ],
    cart: [
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,")
    ],
    bomb: [
      loadImage("data:image/png;base64,")
    ], 
    background: [
      loadImage('data:image/png;base64,')
    ],
    explotion: [
     loadImage('data:image/png;base64,')
   ],
    digiasset: [
     loadImage('data:image/png;base64,')
   ]
  }
  fonts = [
      loadFont('data:@file/x-font-ttf;base64,')
    ]
}

function setup() {
  createCanvas(300, 300);
  textFont(fonts[0]);
  
  textSize(32);
  textAlign(CENTER)
}

let startY = 0
function start() {
  image(img.background[0], 0, 0);
  textSize(25);
  noStroke("#000")
  fill("#FFF")
  text("DIGI\nCOLLECTOR", 150, startY);
  
  if (startY <= 100)
    startY+=2;
  else {
    textSize(15);
    if (floor(millis()) % 1000 > 500){
      text("Press P to play", 150, 225);
    }
      image(img.digiasset[0], 125, 240, 50, 50)
    if(keyIsDown(80) || mouseIsPressed) {
      gameState = 'game';
      startY = 0;
    }
  }
}
function game() {
  stroke('black')
  image(img.background[0], 0, 0);
  for (var i = 0; i < coins.length; i++) {
    coins[i].move();
  
    if (coins[i].y >= 300){
      coins.splice(i--,1);
      continue;
    }
    if (Colision(coins[i].hitbox(), player.hitbox())){
      if (coins[i].isBomb) {
        if (millis() - damageCooldown >= 500) {
          player.life--;
          damageCooldown = millis();
        }
      } else
        player.points++;
      coins.splice(i--,1);
      continue;
    }
    
    coins[i].draw();
  }
  
  if (millis() - coinsCooldown >= 1000) {
    coinsCooldown = millis();
    
    if (Random(0, 4) >= 2)
      coins.push(new Bomb());
    else
      coins.push(new Coin())
    
    velocity+= 0.01;
  }
  
  if (keyIsPressed || movedX != 0)
    player.move()
  player.draw();

  strokeWeight(2)
  fill('white')
  rect(11, 25, 278, 7)
  fill('#0065C7')
  rect(11, 25, (player.points/totalPoints) * 278, 7);
  
  for (var i = 0; i < player.life; i++) {
    fill('red')
    circle(14 * i + 129,17,8)
  }
  
  if (player.points >= totalPoints) {
    gameState = 'win';
    coins = [];
    player = new Player();
    velocity = 1;
  }
  
  if (player.life <= 0) {
    gameState = 'lose';
    coins = [];
    player = new Player();
    velocity = 1;
  }
}

let winY = 0;
function win() {
  image(img.background[0], 0, 0);
  textSize(25);
  noStroke("#000")
  fill("#FFF")
  text("YOU WIN", 150, winY);
  
  if (winY <= 100)
    winY+=2;
  else {
    textSize(15);
    if (floor(millis()) % 1000 > 500){
      text("Press C to see\nthe credits", 150, 200);
    }
      image(img.digiasset[0], 125, 240, 50, 50)
    if(keyIsDown(67) || mouseIsPressed) {
      gameState = 'credits';
      winY = 0;
    }
  }
}

let loseY = 0;
function lose() {
  image(img.background[0], 0, 0);
  textSize(25);
  noStroke("#000")
  fill("#FFF")
  text("YOU LOSE", 150, loseY);
  
  if (loseY <= 100)
    loseY+=2;
  else {
    textSize(15);
    if (floor(millis()) % 1000 > 500){
      text("Press R to retry", 150, 225);
    }
      image(img.digiasset[0], 125, 240, 50, 50)
    if(keyIsDown(82) || mouseIsPressed) { 
      gameState = 'game'; 
      loseY = 0;
    }
  }
}

let creditsY = 300;
function credits() {
  image(img.background[0], 0, 0);
  textSize(10);
  noStroke("#000")
  fill("#FFF")
  text("Created by:\nRenzo Diaz\n\nTwitter\n@RenzoDGB\n\nImages:\nFreePik\n\nFont:\nYuji Adachi", 150, creditsY);
  
  if (creditsY > 45)
    creditsY-=2;
  else {
    textSize(15);
    if (floor(millis()) % 1000 > 500){
      text("Press S to see\nthe title", 150, 220);
    }
      image(img.digiasset[0], 125, 240, 50, 50)
    if(keyIsDown(83) || mouseIsPressed) {
      gameState = 'start';
      creditsY = 300;
    }
  }
}


function draw() {
  switch(gameState) {
      case 'start': start(); break;
      case 'game':  game(); break;
      case 'win': win(); break;
      case 'lose': lose(); break;
      case 'credits': credits(); break;
  }
}